import logo from './logo.svg';
import './sass/App.scss';
import Button from 'react-bootstrap/Button';
import Nav from './components/Nav';

function App() {
  return (
    <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
        <Button variant="primary" size="lg" active>
        This is me
        </Button> 

    </div>
  );
}

export default App;
